function closeTab(tabId, event) {
  event.stopPropagation();
  const tabIndex = tabs.findIndex((t2) => t2.id === tabId);
  if (tabIndex === -1) return;
  const tab3 = tabs[tabIndex];
  const wasActive = tab3.isActive;
  const otherTabsWithSameFile = tabs.filter((t2) => t2.key === tab3.key && t2.id !== tabId);
  if (otherTabsWithSameFile.length === 0) {
    fileContentCache.delete(tab3.key);
  }
  tabs.splice(tabIndex, 1);
  if (wasActive && tabs.length > 0) {
    const newActiveIndex = Math.min(tabIndex, tabs.length - 1);
    switchToTab(tabs[newActiveIndex].id);
  } else if (tabs.length === 0) {
    currentFile = null;
    showWelcomePage();
    updateBreadcrumb("");
    activeTabId = null;
    viewerManager.clearState();
  }
  if (fileContentCache.size > 10) {
    const entries = Array.from(fileContentCache.entries());
    entries.sort((a2, b) => a2[1].timestamp - b[1].timestamp);
    const toDelete = entries.slice(0, entries.length - 10);
    toDelete.forEach(([key]) => fileContentCache.delete(key));
  }
  renderTabs();
}
